    function trackDisplayChanges(element, callback) {
// Create a new MutationObserver
const observer = new MutationObserver((mutations) => {
mutations.forEach((mutation) => {
// Check if the display property has changed
if (mutation.attributeName === 'style' && mutation.target.style.display !== mutation.oldValue) {
callback();
}
});
});

// Configure the observer to watch for attribute changes on the style attribute
observer.observe(element, { attributes: true, attributeFilter: ['style'], attributeOldValue: true });

// Return the observer, so it can be disconnected later if needed
return observer;
}

function updateIframeAutoPlayPopupVideo(popupEl) {
const iframe = popupEl.querySelector('iframe');
if (iframe) {
iframe.setAttribute('allow', 'autoplay');
}
}

function stopVideo(popupEl) {
const iframe = popupEl.querySelector('iframe');
if (iframe) {
let iframeSrc = iframe.src;

if (iframeSrc.includes('?autoplay=1')) {
iframeSrc = iframeSrc.replace('?autoplay=1', '');
}

if (iframeSrc.includes('&autoplay=1')) {
iframeSrc = iframeSrc.replace('&autoplay=1', '');
}

iframe.setAttribute('src', iframeSrc);
}
}

function playVideo(popupEl) {
const iframe = popupEl.querySelector('iframe');

if (iframe) {
const iframeSrc = iframe.src;
if (iframeSrc.includes('?')) {
iframe.setAttribute('src', iframeSrc + '&autoplay=1');
} else {
iframe.setAttribute('src', iframeSrc + '?autoplay=1');
}
}
}

// All popup elements
const popupElements = document.querySelectorAll('[popup-id]');

// Track display changes for all popup elements
popupElements.forEach((popupElement) => {
trackDisplayChanges(popupElement, () => {
updateIframeAutoPlayPopupVideo(popupElement);

if (popupElement.style.display === 'none') {
const videoElement = popupElement.querySelector('video');
if (videoElement) {
videoElement.pause();
} else {
stopVideo(popupElement);
}
}

if (popupElement.style.display === 'block') {
playVideo(popupElement);
}
});
});
